import React from "react";
import "../../css/createExamsheet.css";
import { Card } from "antd";

const Generate = () => {
  return (
    <div>
      <h1 className="Title">View Examsheet</h1>
      <Card
        className="card-edit"
        style={{
          width: '100%',
          height: 600,
          margin: '0 auto', // จัดกึ่งกลาง
        }}
      >
        <p>Card content</p>
      </Card>
    </div>
  );
};

export default Generate;
